import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

import Home from "./components/Home.jsx"

const RouterContainer = () => {
    return (
        <Router>
            <h1>Router</h1>
            <Routes>
                <Route path="/" element={<Home />}/>
            </Routes>
        </Router>
    )
}

export default RouterContainer
